import { createContext, useState } from "react"
import ProdactList from "./prodactlist"
import Navbar from "./Navbar"
export const title=createContext()
function Prd(props){
    const state=useState([
        {id:34,title:"Abdullha1"},
        {id:32,title:"Abdullha2"},
        {id:319,title:"Abdullha3"}]
    )

    return(
        <div>
            <title.Provider value={state}>
           <ProdactList/>
           <Navbar/>
            </title.Provider>
        </div>

    )
}
export default Prd
